export default function UserSettings(props) {
  return (
    <>
      <main className="main-box">
          <h1 className="text-2xl italic font-black tracking-wide text-blue-600 select-none">Profile Photo</h1>
          <img src={props.user.photoURL} alt="user" width="100" className="rounded"/>
          <form className="flex flex-col items-start gap-2 text-blue-700">
              <input type="file" name="imagename" />
              <input type="submit" className="btn"/>
          </form>
          </main>
    </>
  );
}
